text:
@voguemexico 
este fue el año del movimiento feminista #metoo y tú en buena medida representas al "hombre perfecto" ¿para ti qué significa ser hombre hoy?

@nachofigueras 
yo soy un hombre muy feminista. este movimiento es muy importante y necesario, tengo dos hijas y una esposa y lo apoyo fervientemente; pero también siento que no hay que olvidarse del hombre. creo que está habiendo un exceso de femeneidad, que no es ni bueno ni malo, pero el balance entre el hombre y la mujer es importante. por otra parte, no creo en el pago igualitario, si una mujer merece un salario más alto que el de un hombre, porqué no se lo van dar. en mis años con ralph lauren las mujeres ganaban diez veces más que yo porque así era el sistema ... si yo fuera actor en una película con anne hathaway, por qué iría a ganar lo mismo que ella que ganó un oscar... creo que está en mí negociar o no, pero por muchos años no se le dio la oportunidad a las mujeres de negociar desde el mismo nivel.
no podemos olvidarnos del rol del hombre, como tengo hijas, también tengo hijos, y no hay que enseñarle a los hombres a tener miedo a interactuar con las mujeres. creo que eso está pasando. hoy si tienes una reunión con una mujer en una empresa, tienes que dejar la puerta abierta, pero si la mujer solicita la reunión, ella tiene la libertad de cerrarla... no quiero criar a mi hijo diciéndole: cuidado con lo que haces o digas... no se debe perder ese trato entre hombres y mujeres, con todo el respeto del mundo, sin que ninguno le haga al otro lo que no quiere que le hagan. me da mucho miedo tener que decirle en un futuro a mi hijo que no le dé la mano a su novia en el cine. me pone un poco nervioso ese tema. dentro de todo este movimiento, no podemos olvidarnos de los hombres, repito.

